import './App.css'
import { React,useEffect,useState,useRef } from 'react'


export default function Controls({startGame,controls_wrapperRef}) {
  return (
    <div id="controls-wrapper" ref={controls_wrapperRef}>
      <div className="controls-start">
        <span className="material-symbols-outlined play appeared" onClick={null}>play_arrow</span>
      </div>
      <div className="controls-reset">
        <span className="material-symbols-outlined reset appeared">restart_alt</span>
      </div>
    </div>
  )
}

